css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain(client.wedos.com) {

h2 {
	border-bottom: 1px solid #1B1B1B;
}

#header a img{
    top:16px;
    height:100px;
	content: url(data:image/png;base64,)
	
}

#header {
    background-color: #1B1B1B;
    background-image: none;
}

#wrapper, .wrap {
    background-color: #1B1B1B;
    background-image: none;
}

#footer {
	background-color: #272727;
    background-image: none;
}

a {
	color:#0096d6;
}

#content, #menu, .mbox .mwrap {
	background-color: #272727;
    border-width: 0;
}

table {
	border: 1px solid #313131 !important;
}

body, td {
    color: #a2a2a2;
}

td {
	border-bottom: 0px solid #eee;
}

.list_row_2 {
    background-color: #212121;
    line-height: 1.5em;
}

#nav ul li.current a, #nav ul li.current a span  {
	background-image: none;
}

.list_div {;
    border-width: 0;
}

.list_nav {
    margin: 0;
    padding: 10px;
    background-color: #3c3c3c; 
}

.list_nav form table,
.list_nav form table td {
	border-width:0 !important; 
} 

fieldset {
    border: 1px solid #1b1b1b;
}

input {
    background: #1B1B1B !important;
    border: 4px solid #1B1B1B !important;
    margin: 1px;
    color: #ccc !important;
    border-radius: 5px;
    /*box-shadow: 0px 0px 10px 0px rgba(0, 0, 0, 0.82);*/
}

input:hover {
    background: #232323;
    border: 4px solid #232323;
    color: #fff;
    border-radius: 5px;
}

select {
    background-color: #1B1B1B;
    color: #ccc;
	border: 4px solid #1B1B1B;
    border-radius: 5px;
}

select:hover {
    background: #232323;
    border: 4px solid #232323;
    color: #fff;
    border-radius: 5px;
}


.ibox li a {
    font-size: 11px;
    color: #ccc;
    height: 92px;
    width: 92px;
    display: block;
    background: #232323 none 0 0 no-repeat;
    border: 4px solid #232323;
    border-radius: 5px;
}

.ibox li a:hover {
    color: #ccc !important;
    background-image: none !important;
    background-color: #1B1B1B !important;
    border: 4px solid #1B1B1B;
}

.news li.even, .news li.odd {
    background-color: #232323;
    border-bottom:1px solid #1B1B1B;
}


#client-service {
    width: 411px;
    height: 80px;
    background: #fb9901 none 0 0 no-repeat;
        background: #fb9901;
    background: -webkit-gradient(linear, 0 0, 0 100%, from(#fb9901), to(#fbd30f));
    background: -moz-linear-gradient(#fb9901, #fbd30f);
    background: -o-linear-gradient(#fb9901, #fbd30f);
    background: linear-gradient(#fb9901, #fbd30f);
}

#client-service input{
	border-width: 0;
}

#client-service p{
	color: #232323;
}

#client-service p a{
	color: #eee;
    text-decoration: none;
}
#client-service p a:hover{
	text-decoration: none;
    color: #232323;
}

.info_bar {
    border: 1px solid #101010;
    background-color: #564a30;
}

#nav {
    position: absolute;
    left: 1em;
    background-color: #333;
    padding: 0px;
}

#nav li{
	padding: 0px 13px;
}

#nav li:hover {
	background-color: #fb9901;
    color: #ccc;
}


#nav ul li.current{
	color: #fff;
    padding: 0px;
    background-color: #fb9901; 
}

#nav ul li.current a span {
	color: #fff;
    padding-right: 0px;
    background-color: #fb9901; 
}

.list_data {
    background-color: #1b1b1b;
    border-width: 0px;
}

.list_data td {
	border-right: 1px solid #272727;
}

.list_data tr.list_row_2 {
    background-color: #272727;
} 


.list_data tr.list_row_2 td {
    border-right: 1px solid #1b1b1b;
} 

.list_div .list_row_1:hover, .list_div .list_row_2:hover {
    background-color: #3c3c3c;
}

.lookup_bar {
    position: absolute;
    top: 138px;
	width: 275px;
    right: 10px;
    color: #fff;
    padding: 9px;
    background-color: #333;
}

#chat-support {	
    top: 37px;
    height: 41px;
    padding: 0;
    color: #000;
    background: #fb9901;
    background: -webkit-gradient(linear, 0 0, 0 100%, from(#fb9901), to(#fbd30f));
    background: -moz-linear-gradient(#fb9901, #fbd30f);
    background: -o-linear-gradient(#fb9901, #fbd30f);
    background: linear-gradient(#fb9901, #fbd30f);
    -webkit-border-top-left-radius: 50px 50px;
    -webkit-border-top-right-radius: 50px 50px;
    -webkit-border-bottom-right-radius: 50px 50px;
    -webkit-border-bottom-left-radius: 50px 50px;
    -moz-border-radius: 50px / 50px;
    border-radius: 50px / 50px;
}

#chat-support a:hover {	
    color: #eee;
    text-decoration: none;
}

#chat-support:before {
    content: "";
    position: absolute;
    bottom: -30px;
    right: 40px;
    border-width: 0 0 30px 50px;
    border-style: solid;
    border-color: rgba(0, 0, 0, 0) #fbd30f;
    display: block;
    width: 0;
}

#chat-support:after {
    content: "";
    position: absolute;
    bottom: -30px;
    right: 70px;
    border-width: 0 0 30px 20px;
    border-style: solid;
    border-color: rgba(0, 0, 0, 0) #1B1B1B;
    display: block;
    width: 0;
}

#chat-support a {
    display: block;
    height: 22px;
    width: 221px;
    line-height: 12px; 
    text-decoration: none;
    text-align: center;
    margin: -15px 0px;
    padding: 31px 0px;
    font-size: 15px;
    font-weight: bold;
    color: #333;
}
}
